g.desc:
{
"connections":{
"TRND":"$T",
"disable_by":"",
"hide_by":""
},
"metaData":{
"bufferSize":{
"desc":"The size of the buffer in the client webbrowser.<br /><i>Note: if the buffer is larger than the buffer on the device the history is lost when the page is refreshed.</i><br /><i>Note: Large buffer can slow your device especially on slower CPUs like RaspberryPi</i>",
"order":"03",
"type":"number"
},
"connections":{
"TRND":{
"desc":"Set the datapoint to any parameter of the TRND block eg. <code>taskname.TRND:u1</code> to enable reading of all signals.",
"order":"01"
},
"disable_by":{
"desc":"If non-zero the component is disabled and data are no longer updated.",
"optional":true
},
"hide_by":{
"desc":"If non-zero the component is hidden.",
"optional":true
}
},
"desc":"The TRND component is used for displaying the signals from the TRND blocks. Simply just set <code>TRND</code> datapoint to any parameter of the TRND block eg. <code>taskname.TRND:u1</code>. All signals will be displayed in the trend. Each signal can be labeled using <code>signals</code> table.",
"dygraphOptions":{
"desc":"Custom options for Dygraph library. See http://dygraphs.com/options.html for more info.",
"order":"06",
"type":"object"
},
"hideLegend":{
"desc":"Hide the legend of the graph.",
"order":"05",
"type":"bool"
},
"refreshRate":{
"desc":"Custom refresh rate of the trend. Normally the trend is refreshed with the HMI main refresh rate period. If needed each trend can have custom one.",
"min":50,
"order":"04",
"type":"number"
},
"signals":{
"columns":{
"label":{
"order":"01",
"type":"str"
}
},
"desc":"Table of signal labels. Write labels in the same order as you connect the signals to the TRND block.",
"order":"02",
"type":"table"
},
"title":{
"desc":"Trend title",
"order":"01",
"type":"str"
}
},
"options":{
"bufferSize":200,
"dygraphOptions":{},
"hideLegend":"False",
"refreshRate":-1,
"signals":[
{
"label":"timer out"
},
{
"label":"rem. time"
},
{
"label":"OR A"
},
{
"label":"OR B"
}
],
"title":""
}
}

{
"connections":{
"disable_by":"",
"hide_by":"",
"value":"$T_value"
},
"metaData":{
"color":{
"desc":"Normal font color of the display. Applicable for <code>number</code> format only.",
"order":"06",
"type":"color"
},
"colorAbove":{
"desc":"Font color of the display when the read value is above <code>rangeMax</code>. Applicable for <code>number</code> format only.",
"order":"07",
"type":"color"
},
"colorBelow":{
"desc":"Font color of the display when the read value is below <code>rangeMin</code>. Applicable for <code>number</code> format only.",
"order":"08",
"type":"color"
},
"connections":{
"disable_by":{
"desc":"If non-zero the component is disabled and data are no longer updated.",
"optional":true
},
"hide_by":{
"desc":"If non-zero the component is hidden.",
"optional":true
},
"value":{
"desc":"Datapoint from which the value is read.",
"order":"01"
}
},
"decimals":{
"desc":"Round the read value to defined number of decimals. Applicable for <code>number</code> format only.",
"max":"6",
"min":"0",
"order":"05",
"type":"int"
},
"desc":"Display component shows value from the target system as a string. It can be either <code>number</code>, <code>date</code>, <code>datetime</code> or simple value as a <code>text</code> string depending on the <code>format</code> property. Each display can have <code>units</code> which are shown at the end of the displayed string.",
"format":{
"desc":"<code>number</code> - If selected the read value is converted to the number either integer or float. Also the parameters <code>scale</code>,<code>offset</code> and <code>decimals</code> are applied during conversion. The color of the text depends on the <code>color</code> property if the value is higher than <code>rangeMax</code> the <code>colorAbove</code> is used likewise if the value is lower than  <code>rangeMin</code> the <code>colorBelow</code> is applied.<br /><code>time</code> and <code>datetime</code> - The display will convert read value in milliseconds from REX Epoch to the current time or datetime. The property <code>text_format</code> is applied in this context where the format of the displayed time can be selected.<br /><code>text</code> - Simple show the value in the format as was received. Suitable for short strings.",
"order":"01",
"type":"enum",
"values":[
"number",
"time",
"datetime",
"text"
]
},
"offset":{
"desc":"Add some offset to the read value. Applicable for <code>number</code> format only.",
"order":"04",
"type":"float"
},
"rangeMax":{
"desc":"When the read value is above <code>rangeMax</code> the <code>colorAbove</code> color is applied to the font. Applicable for <code>number</code> format only.",
"order":"09",
"type":"float"
},
"rangeMin":{
"desc":"When the read value is below <code>rangeMin</code> the <code>colorBelow</code> color is applied to the font. Applicable for <code>number</code> format only.",
"order":"10",
"type":"float"
},
"scale":{
"desc":"Scale the read value. Applicable for <code>number</code> format only.",
"order":"03",
"type":"float"
},
"text_format":{
"desc":"Select the format of the time string for <code>time</code> and <code>datetime</code>.",
"order":"02",
"type":"enum",
"values":[
"",
"hh:mm:ss",
"hh:mm"
]
},
"units":{
"desc":"Append some string to the end of the displayed value. Usually the name of the units.",
"order":"11",
"type":"str"
},
"updateType":"Partial"
},
"options":{
"color":"#000000",
"colorAbove":"#ff0000",
"colorBelow":"#0000ff",
"decimals":2,
"format":"number",
"offset":0,
"rangeMax":10,
"rangeMin":0,
"scale":1,
"text_format":"",
"units":""
}
}

{
"connections":{
"disable_by":"",
"error_by":"",
"hide_by":"",
"value":"$T"
},
"metaData":{
"colorError":{
"desc":"LED background color when the signal error is TRUE.",
"order":"04",
"type":"color"
},
"colorFalse":{
"desc":"LED background color when the signal is OFF, DISABLED, ...",
"order":"03",
"prev":[
"colorStop",
"color_false"
],
"type":"color"
},
"colorTrue":{
"desc":"LED background color when the signal is ON, ENABLED, ...",
"order":"02",
"prev":[
"colorRun",
"color_true"
],
"type":"color"
},
"connections":{
"disable_by":{
"desc":"If non-zero the component is disabled and data are no longer updated.",
"optional":true
},
"error_by":{
"desc":"If set and TRUE the led will show <code>colorError</code>",
"optional":true,
"order":"02"
},
"hide_by":{
"desc":"If non-zero the component is hidden.",
"optional":true
},
"value":{
"desc":"Datapoint from which the value is read.",
"order":"01",
"prev":[
"LIGHT",
"POWER"
]
}
},
"desc":"Boolean state indicator. Empty or Zero mean OFF,FALSE, otherwise ON, TRUE. This can be switched using <code>reverseMeaning</code> parameter.",
"reverseMeaning":{
"desc":"If True the meaning of the value is switched. So the ON state is False and OFF state is True.",
"order":"01",
"type":"bool"
}
},
"options":{
"colorError":"#DF2626",
"colorFalse":"#B8BDC5",
"colorTrue":"#00C8B4",
"reverseMeaning":"False"
}
}

{
"connections":{
"disable_by":"",
"hide_by":"",
"refresh_from":"",
"value":"$T_W"
},
"metaData":{
"connections":{
"disable_by":{
"desc":"If non-zero the component is disabled and data are no longer updated.",
"optional":true
},
"hide_by":{
"desc":"If non-zero the component is hidden.",
"optional":true
},
"refresh_from":{
"desc":"Optional datapoint where the value is updated.",
"optional":true,
"order":"02",
"prev":[
"value_R"
]
},
"value":{
"desc":"Datapoint where the value is written.",
"order":"01",
"prev":[
"value_W"
],
"write":true
}
},
"css":{
"desc":"Custom CSS style for the HTML input object. For example \\{'background-color':'#00ffff'\\}",
"order":"11",
"type":"object"
},
"decimals":{
"desc":"Round the value to defined number of decimals. Applicable for <code>number</code> format only.",
"max":"6",
"min":"0",
"order":"06",
"type":"int"
},
"desc":"Input component allow to write numbers, texts, dates or times to the target. If the <code>number</code> format is selected the value can be converted using <code>scale</code> and <code>offset</code> adn rounded to number of <code>decimals</code>. The Input allows to limit user input to the range defined by <code>min</code> and <code>max</code> parameters. There is <code>virtualKeyboard</code> available for kiosk mode devices. The <code>date</code>, <code>time</code> and <code>datetime</code> format has a special widget to enter the dates. The value from this format is converted to the number of milliseconds from REX epoch.<br /><i>Note:The value is written to the <code>value</code> datapoint, if necessary it can be refresh from different location defined in the  <code>refresh_from</code> datapoint. It can be used if the value is limited by saturation. </i>",
"fontScale":{
"desc":"The Input is using HTML input component which is not binded with SVG. Use this parameter to scale font.",
"order":"02",
"type":"float"
},
"format":{
"desc":"<code>number</code> - If selected the value is converted to the number either integer or float. Also the parameters <code>scale</code>,<code>offset</code> and <code>decimals</code> are applied during conversion.<br /><code>time</code> and <code>datetime</code> - The input will convert time or datetime to the number of milliseconds from REX Epoch.<br /><code>text</code> - Simple enter the value in the format as is. Suitable for short strings.",
"order":"01",
"type":"enum",
"values":[
"number",
"text",
"date",
"time",
"datetime"
]
},
"max":{
"desc":"The maximum value user can enter. Applicable for <code>number</code> format only.",
"order":"08",
"type":"float"
},
"min":{
"desc":"The minimum value user can enter. Applicable for <code>number</code> format only.",
"order":"07",
"type":"float"
},
"offset":{
"desc":"Add some offset to the value. Applicable for <code>number</code> format only.",
"order":"05",
"type":"float"
},
"scale":{
"desc":"Scale the value. Applicable for <code>number</code> format only.",
"order":"04",
"type":"float"
},
"setOnBlur":{
"desc":"If True the data input value is set on blur event (Press ESC to cancel write).",
"order":"09",
"type":"bool"
},
"textAlign":{
"desc":"The Input is using HTML input component which is not binded with SVG. Use this parameter to scale font.",
"order":"03",
"type":"enum",
"values":[
"left",
"center",
"right"
]
},
"virtualKeyboard":{
"desc":"If True the virtual keyboard is show for data input.",
"order":"10",
"type":"bool"
},
"writePerm":{
"columns":{
"login":{
"type":"str"
}
},
"desc":"List of logins who are allowed to write to the data point. If not in list the Input will be disabled.",
"order":"12",
"type":"table"
}
},
"options":{
"css":{},
"decimals":2,
"fontScale":2.0,
"format":"number",
"max":"",
"min":"",
"offset":0,
"scale":1,
"setOnBlur":"False",
"textAlign":"left",
"virtualKeyboard":"False",
"writePerm":[]
}
}

