{
"connections":{
"disable_by":"",
"hide_by":"",
"refresh_from":"",
"value":"$T"
},
"metaData":{
"colorFalse":{
"desc":"Button background color when the state is OFF",
"order":"03",
"type":"color"
},
"colorTrue":{
"desc":"Button background color when the state is ON",
"order":"04",
"type":"color"
},
"connections":{
"disable_by":{
"desc":"If non-zero the component is disabled and data are no longer updated.",
"optional":true
},
"hide_by":{
"desc":"If non-zero the component is hidden.",
"optional":true
},
"refresh_from":{
"desc":"If set the state of the component is updated based on the value read from this datapoint. Otherwise the value from main datapoint is used.",
"optional":true,
"order":"02",
"prev":[
"VALUE_R"
]
},
"value":{
"desc":"Datapoint where boolean value is written.",
"order":"01",
"prev":[
"VALUE_W",
"BUTTON"
],
"write":true
}
},
"desc":"The PushOnOff button component changes the boolean value. Normally the ON state means TRUE value and OFF mean FALSE value. If needed the parameter <code>reverseMeaning</code> switches the written values.<br /> There are three different modes of operation: <br /><code>PushButton</code> when press or touched the ON state is written to the target <code>value</code> datapoint. When  released the OFF state is written.<br /><code>ManualPulse</code> always write TRUE value after button is pressed, release is ignored.(Suitable for MP block control)<br /><code>ToggleButton</code> when button is pressed the value is toggled (ON -> OFF -> ON).",
"reverseMeaning":{
"desc":"If True the meaning of the value is switched. So the ON state is False and OFF state is True.",
"order":"02",
"prev":[
"reverse_meaning"
],
"type":"bool"
},
"type":{
"desc":"Changes the type of the Button.<br /><code>PushButton</code> when press or touched the ON state is written to the target <code>value</code> datapoint. When released the OFF state is written.<br /><code>ManualPulse</code> writes TRUE value once after button is pressed, release is ignored.<br /><code>ManualPulseRpt</code> writes TRUE value periodically (20ms period) after button is pressed, release stops writing.(Suitable for MP block control)<br /><code>ToggleButton</code> when button is pressed the value is toggled (ON -> OFF -> ON).",
"order":"01",
"type":"enum",
"values":[
"PushButton",
"ManualPulse",
"ManualPulseRpt",
"ToggleButton"
]
},
"writePerm":{
"columns":{
"login":{
"type":"str"
}
},
"desc":"List of logins who are allowed to write to the data point. If not in list the Button will be disabled.",
"order":"05",
"type":"table"
}
},
"options":{
"colorFalse":"#B8BDC5",
"colorTrue":"#00C8B4",
"reverseMeaning":false,
"type":"ToggleButton",
"writePerm":[]
}
}

