"desc":"Changes the default read refresh rate of the whole HMI. Default 500ms",
"max":"300000",
"min":"20",
"order":"02",
"type":"int"
},
"show_clock":{
"desc":"If True the clock are shown in the right upper corner of the template instead of blinking square. If the target is connected the clock are updated if connection get error o lost the time stops.",
"order":"04",
"type":"bool"
},
"target_url":{
"desc":"The URL of the target device. So far only the WebSocket protocol is supported. The URL must also contain the PORT, but the protocol can be omitted. Default is empty string which means ws://127.0.0.1:8008 <br /> Examples: 192.168.1.100:8008 or wss://192.168.1.100:8009 <br /> <i> Note: If the HMI is hosted on the internal web server this option is ignored and HMI connects to the hostname / IP you use in the webbrowser URL.</i>",
"order":"01",
"prev":[
"ws_ip"
],
"type":"str"
},
"use_client_time":{
"desc":"If True the <code>show_clock</code> display the time from client computer rather then target. This can be use when target device does not have NTP synchronization or RTC chip.",
"order":"05",
"type":"bool"
}
